// ==UserScript==
// @name          MrMonkE's Generic Newzbin Script 2000 
// @description   Data enrichment and one-click add to sabnzbd for all posts.   
// @include       http://v3.newzbin.com/*
// @include       http://www.newzbin.com/*
// @include       http://www.newzxxx.com/*
// @include       https://v3.newzbin.com/*
// @include       https://www.newzbin.com/*
// @include       https://www.newzxxx.com/*
// ==/UserScript==
//   
// -----------------------------------------------------------------------------
// Other free usenet stuff you could be using.
// -----------------------------------------------------------------------------
//
//       If you don't use NZB-TV and sabnzbd .... you are doing it wrong! ;)
//
//
//       NZB-TV : http://www.two-sided.com/               (Windows only)
//       ----------------------------------
//       A free program that gets episodes of your shows automatically.
//       If you download a lot of TV episodes and run windows check out NZB-TV   
//       It gets NZB files from Newzbin that match the shows, films and season
//       DVDs you like! Remembers previous downloaded episodes, so no duplicates
//       are downloaded. Allows you to use Newzbin attributes and size filters.
//
//
//       SABNZBD : http://www.sabnzbd.org/                (Any OS)
//       ----------------------------------
//       sabnzbd is a free/open-source cross-platform binary newsreader written
//       in Python. It simplifies the process of downloading from Usenet 
//       dramatically, thanks to its friendly web-based user interface and 
//       advanced built-in post-processing options that automatically verify, 
//       repair, extract and clean up posts downloaded from  Usenet. 
//
// -----------------------------------------------------------------------------

// -----------------------------------------------------------------------------
//  The base of this script was: http://userscripts.org/scripts/review/23675
//  by cflat who adapted from Long Johnson's script 
//  It's has changed dramatically since then.
//  This script : 
//      - One-click add for sabnzbd added to the newsgroups area so no extra  
//        space is taken when a report is not a film or there is no known link.
//        Useage: Click the sabnzbd icon or click the text 'download' on the 
//                right ofthe sabnzb icon.
//      - Imdb rating with 1 decimal. Looks better.
//      - Plot. 
//      - Number of votes.
//      - Expandable div with:
//        - Title
//        Sub div: Film details 
//          - Link to IMDB film page.
//          - Link to IMDB actors and crew page.
//          - Directors, with links.
//          - Genres, with links to IMDB genre page.
//          - Company, with link to IMDB company page.
//          - Awards.
//        Sub div: Fun stuff :: Scrolls
//          - Trivia, with links to the films IMDB Trivia page.
//          - Goofs, with links to the films IMDB Goofs page.
//          - Quotes, with links to the films IMDB Quotes page.
//          - Movie connections, with links to the films IMDB Movie Connections
//            page.
//          - Soundtrack, with links to the films IMDB Soundtrack page.
//        Sub div: Certification :: Scrolls
//          - Certification. Age, PG and countrie info.
//        Sub div: Actors :: Scrolls
//          - List actors listed on IMDB film page. For full list use 
//            'Full cast & crew' link in Film Details.
//          - Click actor name to open that actors IMDB page  
//        Sub div: Poster
//          - Shows movieposter when available. Otherwise shows the image found
//            at 'imgLinkMissingCover' setting.
//          - To disable images set showPosterImages to 'false'.
//          - Click poster to open the poster in full size (Biggest as IMDB has
//            it, this can be smaller too than what you see!). 
//          - Click link under poster to open the poster in full size (Biggest
//            as IMDB has it, this can be smaller too than what you see!).
//      - Use either IMDB button to close the opened div.
//
//      Retry:
//      - Failed url (a non 200 response) is retried so a proxy timeout won't 
//        cause missing details. This happens a lot at IMDB I noticed. 
//        At least once every 50-report page.
// -----------------------------------------------------------------------------

// -----------------------------------------------------------------------------
// TODO:
//    - Load poster images AFTER DIV is opened. 
//    - Add targets to the links in the source HTML too so all links go
//      to otehr windows.
//    - Implement other sites. e.g.: TVrage, TheTVDB, Amazon.
//    - Add error handling.
// -----------------------------------------------------------------------------

// -----------------------------------------------------------------------------
// DO NOT TOUCH BELOW HERE!! NO NEED UNLESS YOU ARE MODIFYING FUNCTIONALITY.
// If you add something nice email it. 
// eMail: MrMonkE@two-sided.com
// -----------------------------------------------------------------------------
// Hello developpers.
// I made it so the IMDB part is seperated and that other urls can be 
// added by implementing the TEMPLATE
// Thats the plan at least.
// So if you add something.. share with all of us. Thanks! :)
// -----------------------------------------------------------------------------

// -----------------------------------------------------------------------------
// G L O B A L V A R S
// -----------------------------------------------------------------------------
//  IMAGES
// -----------------------------------------------------------------------------
// Sab download icon, left of the "Download" text.
  var imgLinkSabLogo = "data:image/png;base64,%3D";
// ImdbLogo button. When you click this it opens or closes the IMDB data
  var imgLinkImdbLogo = "data:image/png;base64,%3D";
// If a movie has no cover this image is substituted for it. Looks better.
  var imgLinkMissingCover = "data:image/png;base64,%3D%3D";
// -----------------------------------------------------------------------------    
// Settings div
  var ConfigDiv = "<a href=\"#\" onclick=\"if(document.getElementById('MrMonkESettings').style.display != 'none') {document.getElementById('MrMonkESettings').style.display = 'none' } else { document.getElementById('MrMonkESettings').style.display = 'block'} return true;\">MrMonkE script settings</a><div id=\"MrMonkESettings\" style=\"display:none;position: absolute; z-index: 4;width:494px;background-color:LightGrey;border: solid 1px black\" ><table style=\"width:483px; font-family: Arial, Helvetica, sans-serif; font-size: small;\" ><tr ><td colspan=\"3\"><b>MrMonkE script settings</b></td></tr><tr><td style=\"text-align:right;width:100px\" >Sabnzbd&nbsp;url</td><td style=\"width:10px\" >:</td><td style=\"width:290px\"><input id=\"tbSabLocation\" style=\"width: 328px;\" type=\"text\" /></td></tr>  <tr><td style=\"text-align:right;width:100px\" >&nbsp;</td><td style=\"width:10px\" >&nbsp;</td><td style=\"width:290px\">e.g.: http://192.168.0.2:8080/sabnzbd&nbsp;&nbsp;&nbsp;Case sensitive!</td></tr><tr><td style=\"text-align:right;\">Sabnzbd&nbsp;API&nbsp;key</td><td >:</td><td ><input id=\"tbApiKey\" style=\"width: 328px;\" type=\"text\" /></td></tr><tr><td style=\"text-align:right;\">Show covers</td><td >:</td><td ><input id=\"cbshowPosterImages\" type=\"checkbox\" /></td></tr><tr><td colspan=\"3\"><input id=\"btnRestore\" type=\"button\" style=\"width:120px\" value=\"Restore\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<input id=\"btnCancel\" style=\"width:120px\" type=\"button\" value=\"Cancel\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<input id=\"btnSave\" type=\"button\" style=\"width:120px\" value=\"Save Settings\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<input id=\"btnAbout\" type=\"button\" value=\"About\" /></td></tr></table></div>";
// -----------------------------------------------------------------------------
  var SabLocation = "";
  var ApiKey = "";
  var showPosterImages  = "";
  var NeedSettings = true;
// -----------------------------------------------------------------------------
// End Of G L O B A L V A R S
// -----------------------------------------------------------------------------

// -----------------------------------------------------------------------------
// MAIN
// -----------------------------------------------------------------------------
  main();
  
  function main()
  {
  var listRegex = new RegExp(".+searchaction=.+|.+browse\/category.+");
  var singleRegex = new RegExp(".+browse\/post.+");
  addSettingsTab();
  if(NeedSettings)
    return;
  if(location.href.match(listRegex ))
    ProcessList();
  if(location.href.match(singleRegex))  
    ProcessSingle();
  }
// -----------------------------------------------------------------------------
// END OF MAIN loop
// -----------------------------------------------------------------------------


function getSettings()
{
  SabLocation = GM_getValue("SabLocation", "");
  ApiKey = GM_getValue("ApiKey", "");
  showPosterImages  = GM_getValue("showPosterImages", true);
  document.getElementById('tbSabLocation').value = SabLocation;
  document.getElementById('tbApiKey').value = ApiKey ; 
  document.getElementById('cbshowPosterImages').checked = showPosterImages ;
  // --- If we don't have minimal required settings show the screen.
  if(ApiKey == "" || SabLocation == "")
  { NeedSettings = true; 
    document.getElementById('MrMonkESettings').style.display = 'block';
  }
  else
  {
    NeedSettings = false;
  }
}

function addSettingsTab()
{
  var Tab = document.evaluate("//ul[@id='mnMain']",   document,   null,   XPathResult.UNORDERED_NODE_SNAPSHOT_TYPE,   null);

  if(Tab.snapshotLength > 0)
  {
      Tab  = Tab.snapshotItem(0);
      Tab.innerHTML += "<li class=\"selected\">"+ConfigDiv+"</li>"; 
  }

  // add event to buttons
  var SaveButton= document.getElementById("btnSave");   
  SaveButton.addEventListener("click",Save, true);

  var CancelButton= document.getElementById("btnCancel");   
  CancelButton.addEventListener("click",CancelSave, true);

  var RestoreButton= document.getElementById("btnRestore");   
  RestoreButton.addEventListener("click",Restore, true);

  var RestoreButton= document.getElementById("btnAbout");   
  RestoreButton.addEventListener("click",About, true);

  // Get Settings
  getSettings();
} 


function CancelSave()
{
  document.getElementById('MrMonkESettings').style.display = 'none'; // That's all there is.
  getSettings();
}

function Save()
{
  GM_setValue("SabLocation", document.getElementById('tbSabLocation').value);
  GM_setValue("ApiKey", document.getElementById('tbApiKey').value);
  GM_setValue("showPosterImages", document.getElementById('cbshowPosterImages').checked);
  getSettings();
  window.location.reload();
  // hide
  document.getElementById('MrMonkESettings').style.display = 'none';
}

function  Restore()
{
  getSettings();
}

function  About()
{
  window.open('http://www.two-sided.com/', 'twosided', '');
}


// -----------------------------------------------------------------------------
// Process the single
// -----------------------------------------------------------------------------
function ProcessSingle()
{
  var postidRegexp = RegExp("http://www.newzbin.com/browse/post/([0-9]+)")
  var PostID = location.href.match(postidRegexp);
  if(PostID )
  {
    var downloadLink = makeDownloadLink(PostID [1]);
    if(downloadLink != "")
    {
      var Title = document.evaluate("//tr[./th[text()='Title:']]/td",   document,   null,   XPathResult.UNORDERED_NODE_SNAPSHOT_TYPE,   null);
      if(Title.snapshotLength > 0)
      {
        Title = Title.snapshotItem(0);
        Title.innerHTML += "&nbsp;&nbsp;&nbsp;&nbsp;" + downloadLink ;   
      }
    }  
  }
}


// -----------------------------------------------------------------------------
// Process the list
// -----------------------------------------------------------------------------
function ProcessList()
{
  // -----------------------------------------------------------------------------
  // link types we can process (Currently only IMDB)
  // -----------------------------------------------------------------------------
  var imdbLinkRegex = new RegExp("http://[a-z.]+\.imdb\.com/[a-zA-Z0-9/+_-]+");
  //var ????LinkRegex = new RegExp("http://[a-z.]+\.????\.com/[a-zA-Z0-9/+_-]+");
  // -----------------------------------------------------------------------------
  // END of link types
  // -----------------------------------------------------------------------------
  
  
  // -----------------------------------------------------------------------------
  // MAIN loop. Loops rows with newsbin reports.
  // -----------------------------------------------------------------------------
  // Get rows with Newzbin 'posts'
  var postidRegex = new RegExp('/browse/post/([0-9]+)/');
  var movies = document.evaluate("//tbody[@class='odd' or @class='odd-new' or @class='even' or @class='even-new']",   document,   null,   XPathResult.UNORDERED_NODE_SNAPSHOT_TYPE,   null);
  for (var i = 0; i < movies.snapshotLength; i++)
  {
    // Get row body
  	movieBody = movies.snapshotItem(i);
  	
  	// -------------------------------------------------------------------
    // Get PostID, same for each link type
    var PostID = movieBody.innerHTML.match(postidRegex);
    PostID  = PostID[1];
    // -------------------------------------------------------------------
    
    // -------------------------------------------------------------------	
  	// Is IMDB link? Then process it
    // -------------------------------------------------------------------	
  	var imdbLink = movieBody.innerHTML.match(imdbLinkRegex);
    if (imdbLink) 
    {
      setGeneric(movieBody, i, PostID  );
      RetryNumbers = 2;
      getData_IMDB(movieBody, imdbLink.toString(),i, PostID, RetryNumbers  )  
      continue; // --- If we processed this as IMDB skip others       
    } 
    
    // something else; just DOWNLOAD link then
    setGeneric(movieBody, i, PostID  );
    
   
    // -------------------------------------------------------------------	
  	// Is ???? link? Then process it                  TEMPLATE
    // -------------------------------------------------------------------	
  	//var ????Link = movieBody.innerHTML.match(????LinkRegex);
    //if (????Link) 
    //{
    //  getData_IMDB(movieBody, ????Link.toString(),i, PostID  )
    //  continue; // --- If we processed this as ???? skip others       
    //}
    // --- Amazon?
    // --- TV Rage?
    // --- Others?
  
  
  } // --- End of for-loop 

}

// -----------------------------------------------------------------------------
// Generic: Download button
// -----------------------------------------------------------------------------
function setGeneric(movieBody, i, PostID  )
{
    var newsGroups = document.evaluate("tr/td/span/a[@title='Exclude this newsgroup']/..", movieBody,   null,   XPathResult.UNORDERED_NODE_SNAPSHOT_TYPE,   null);
    if(newsGroups)
      {
        var downloadLink = makeDownloadLink(PostID);
        if(downloadLink != "")
          newsGroups.snapshotItem(0).innerHTML = downloadLink + newsGroups.snapshotItem(0).innerHTML;
        }
}

function makeDownloadLink(PostID)
{
    var downloadLink = 
          "<A title=\"Add report to sabnzbd\" href=\"#\" onclick=\"javascript: var img = new Image();img.src='" + SabLocation 
        + "/api?mode=addid&name=" + PostID 
        + "&apikey=" + ApiKey 
        + "';this.parentNode.parentNode.parentNode.parentNode.style.opacity=0.5;return false\"><img src=\"" + imgLinkSabLogo 
        + "\">&nbsp;sabnzbd</A>&nbsp;&nbsp;";

        if(!downloadLink) 
          downloadLink = "";
        return downloadLink;
}

// -----------------------------------------------------------------------------
// END of Generic
// -----------------------------------------------------------------------------


// -----------------------------------------------------------------------------
// IMDB PART -- Carefull, touchy you breaky. IMDB changy.. it breaky. 
// -----------------------------------------------------------------------------

// -----------------------------------------------------------------------------
// Regular expressions for IMDB data extraction
// -----------------------------------------------------------------------------
var ratingRegex = new RegExp("[0-9]\.[0-9]+(?=/10)");
var plotRegex = new RegExp("<h5>Plot:[^<>]*</h5>([^]*?)(?=(<a class)|(<\/div))");
var newzBinTitleRegex = new RegExp("^http:\/\/(www|v3)\.newzbin\.com\/browse\/post\/[0-9]+\/$");
var castRegex = new RegExp("<table class=\"cast\">([^]*?)(?=</table>)");
var awardRegex = new RegExp("<h5>Awards?:<\/h5>([^]*?)(?=<a class)");
var directorRegex = new RegExp("<h5>Directors?:<\/h5>([^]*?)(?=<\/div>)");
var genreRegex = new RegExp("<h5>Genre:<\/h5>([^]*?)(?=<\/div>)");
var companyRegex = new RegExp("<h5>Company:<\/h5>([^]*?)(?=<\/div>)");
var photoRegex = new RegExp("<a name=\"poster.+src=\"([^]*?)(?=\" \/>)");
var funstuffRegex = new RegExp("<h3>Fun Stuff<\/h3>([^]*?)(?=<hr\/>)");
var certificationRegex = new RegExp("<h5>Certification:<\/h5>([^]*?)(?=<\/div>)");
var votesRegex = new RegExp("&nbsp;&nbsp;<a href=\"ratings.+\">([^]*?)(?=votes<\/a>)");
var titleRegex = new RegExp("<title>([^]*?)(?=</title>)");
// -----------------------------------------------------------------------------
// END of Regular expressions for IMDB data extraction
// -----------------------------------------------------------------------------


// -----------------------------------------------------------------------------
// Do all IMDB actions.
// This launches an asynchronous call to IMDB and when it returns with 
// onLoad perfroms the extraction
// -----------------------------------------------------------------------------
function getData_IMDB(movieBody, imdbLink, iLink, PostID , RetryNumbers )
{
   GM_xmlhttpRequest({      method: 'GET',      url: imdbLink,	  headers: {'Referer': imdbLink, 'Accept': 'application/atom+xml,application/xml,text/xml', 'User-agent': 'Mozilla/4.0 (compatible)'}, onload: function (responseDetails)
      {
         if (responseDetails.status == 200)
         {
            // Each div needs a unique name, create it here. used later.
            var divName = "actors" + iLink

            // All URLS from relative to absolute on IMDB.com site. 
            // This makes all links in the extracted HTML go to IMDB. 
            // TODO: Add targets to the links in the source HTML too. 
            var source = responseDetails.responseText.replace(/src='\//g, "src='http://www.imdb.com/");
  		      source = source.replace(/src="\//g, "src=\"http://www.imdb.com/");                
  		      source = source.replace(/href='\//g, "href='http://www.imdb.com/");
  		      source = source.replace(/href="\//g, "href=\"http://www.imdb.com/");
            source = source.replace(/|/, "");         
        
            // Do all the matching here. Use regexpes to get data we want 
            // from the source HTML.
            // PS: SOurce is what we got back from IMDB.com, the page/HTML            
            var ratingMatch   = source.match(ratingRegex);
      			var descMatch     = source.match(plotRegex);
      			var castMatch     = source.match(castRegex);
      			var companyMatch  = source.match(companyRegex);
      			var awardMatch    = source.match(awardRegex);
      			var directorMatch = source.match(directorRegex);
            var genreMatch    = source.match(genreRegex);
            var photoMatch    = source.match(photoRegex );
            var funstuffMatch = source.match(funstuffRegex);
            var certificationMatch = source.match(certificationRegex);           
            var votesMatch = source.match(votesRegex);
            var titleMatch = source.match(titleRegex); 
	        							
            // 	Extract Rating; that users on IMDB have given for this film
            //  Displayed right of the IMDB button together with votes.
              if (ratingMatch)
              {               
            	 rating = parseFloat(ratingMatch);
            	 rating = rating.toFixed(1)
               var allLinks = movieBody.getElementsByTagName("a");
               var curLink;               
               for (var i = 0; i < allLinks.length; i++)
               {
                curLink = allLinks[i];
                if (newzBinTitleRegex.exec(curLink) != null)
                {
						     curLink.innerHTML += "&nbsp;&nbsp;&nbsp;" + rating + " " + "<A name=\"an" + iLink + "\">";
                 break;                      
                }
            	 }
              }

              // Film Plot
              var Plot = "No plot information available."
			        if (descMatch) Plot =descMatch[1];
			        // Remove annoying | symbol. Change regexp realy.. Todo
              Plot = Plot.replace( new RegExp("|", "g" ), ""); 
				
				
				
				      // Film Cast; Extracts all rows. including the <TR> </TR>  
              // Need to put this inside <table> </table> !!
				      var cast = "No cast information available."
				      var goodStyle = "style=\"background-color:white;border-bottom:1px solid lightgrey;\""
              if (castMatch) cast = castMatch[1]
              // Convert to single regexp later.
              cast = cast.replace( new RegExp("colspan=.?4.?", "g" ), "colspan=\"4\" " + goodStyle);
              cast = cast.replace( new RegExp("class=\"odd\"", "g" ), goodStyle);
              cast = cast.replace( new RegExp("class=\"even\"", "g" ), goodStyle);
              cast = cast.replace( new RegExp("class=\"nm\"", "g" ), goodStyle);
              cast = cast.replace( new RegExp("class=\"hs\"", "g" ), goodStyle);
              cast = cast.replace( new RegExp("class=\"ddd\"", "g" ), goodStyle);
              cast = cast.replace( new RegExp("class=\"char\"", "g" ), goodStyle);

              // Details link; IMDB logo acts as button. Click to show/hide             
              var detailsLink = "&nbsp;<A title=\"Click here to Show/Hide IMDB details\" href=\"#an" + iLink 
              + "\" onclick=\"if(document.getElementById('"+divName + "').style.display != 'none') {document.getElementById('"+divName + "').style.display = 'none' } else{ document.getElementById('"+divName + "').style.display = 'block'} return true; \" >"
              + "<img align=\"top\"  src=\""+ imgLinkImdbLogo +"\"></a> ";
              if(!detailsLink) detailsLink= "";                             
                            
              // Links to IMDB flim page. 
              var imdbLinkFilm = "<A title=\"Open IMDB page with all film info.\" href=\"" + imdbLink + "\" target=\"_imdbfilm\" >Film</A>";
              if(!imdbLinkFilm ) imdbLinkFilm = "";              
               
              // Links to cast and crew, info on 'our' page is only a
              // partial list. This link links to the full list at IMDB.
              var imdbLinkActors= "<A title=\"Open IMDB page with full cast and crew info.\" href=\"" + imdbLink + "fullcredits#cast\" target=\"_imdbactors\" >Full cast &amp; crew</A>";
              if(!imdbLinkActors) imdbLinkActors= "";

              // Director of the Film. 
              // This is a link that stay on the page newzbin page :/ See TODO:
              var Director = "No director info found";
              if(directorMatch) Director = directorMatch[1];
              Director = Director.replace( new RegExp( "[<>]?br\/[<>]?", "g" ), "&nbsp;&nbsp;&nbsp;&nbsp;" );

              // Genre of the film.
              var Genre= "No genre info found";
              if(genreMatch) Genre= genreMatch[1];
              
              // Company that made the film              
              var Company = "No company info found";
              if(companyMatch) Company = companyMatch[1];                            
  
              // Awards won by the film.
              var Award = "No known awards";
              if(awardMatch) Award= awardMatch[1];           

              // The number of votes the film got from IMDB users. 
              // Displayed right of the IMDB button together with rating
              var Votes = "";
              if(votesMatch) Votes = " - " +  votesMatch[1];         

              var Title= "";
              if(titleMatch) 
                Title = "&nbsp;&nbsp;<strong>" + titleMatch[1]; + "</strong>"
  
              // Poster of the film. When missing use default.
              // Set HEIGHT to 590 so it will fit in layout. 
              // Width can be adjusted by browser so it keeps aspect ratio
              var PhotoLink ="";              
              if(showPosterImages)
              {
                PhotoLink = "<img height=\"590\" src=\"" + imgLinkMissingCover + "\" />";              
                if(photoMatch)
                { 
                  imgLink = photoMatch[1];
                  imgLink = imgLink .replace( new RegExp("@@.+SX[0-9]+_SY[0-9]+.+", "g" ), "@@"); // --- Remove size info.
                  imgLink = imgLink .replace( new RegExp("_V1\.+", "g" ), ""); // --- Remove size info. (Apparently there are at least 2 methods at IMDB for this.)
                  PhotoLink = "<a target=\"_Poster\" title=\"Click here to open poster in a new window.\" href=\"" + imgLink + "\"><img height=\"590\" src=\"" + imgLink + "\" /></a>" 
                  + "<br><center><a target=\"_Poster\" title=\"Click to open in new window.\" href=\"" + imgLink + "\">Click here or on the poster to open it in a new window.</a></center>";                
                }
              }
         
              // -- Trivia goofs quotes and soundtrack info => funstuff 
              var funstuff = "No trivia/goofs/quotes found";
              if(funstuffMatch) funstuff= funstuffMatch[1];           
              funstuff = funstuff.replace( new RegExp("<div class=\"info\">", "g" ), "<br>");
              funstuff = funstuff.replace( new RegExp("<\/div>", "g" ), "<br>");
              funstuff = funstuff.replace( new RegExp("<h5>", "g" ), "<b>");
              funstuff = funstuff.replace( new RegExp("<\/h5>", "g" ), "</b><br>");             

              // Film certification. PG/Ages for different countries. 
              // We put this in a seperate DIV later so it can scroll.
              var certification = "unknown";
              if(certificationMatch) certification = certificationMatch[1];                           

              // Build the whole thing
              // 1st: ROW with IMDB button and score/votes followed by Plot.    
              Details = "<tr><td style=\"vertical-align:center;text-align:left;\" colspan='3' >"
              + detailsLink + "&nbsp;<small>" + rating + "&nbsp;" + Votes + "votes</small>"           
              + "</td><td  colspan='3' >Plot: " + Plot + "</td></tr>"                   
              
              // ROW with the DIV that's opened and closed by the button.
              // Note: left:40px; to have a 40 pixel space left of the DIV
              //       We need this so when we click and scroll the mouse 
              //       wheel the mousepointer does not come above dovs 
              //       with scrollbars. This allows us to scroll down 
              //       better to the next title/IMDB button.               
              + "<tr><td colspan='6' >"
              + "<div id='"+ divName + "' style='overflow:visible;height:685px;width: 95%;display:none; background-color: none; position:relative; left:40px; top:1px; border-style: none; padding: 0px'>"
              + "<div style=\"background-color: white;-moz-border-radius: 5px;-webkit-border-radius: 5px;padding: 10px;\" \">"

              // Film Title
              + Title              
              + "<table style=\"background-color: white\">"
              + "<tr><td rowspan=\"2\" style=\"background-color: white; vertical-align: top\">"            

                // Film info DIV
                + "<div style=\"height:180px;background-color: #fff;-moz-border-radius: 5px;-webkit-border-radius: 5px;border: 1px solid #000;padding: 10px;\" >" 
                + "<table width=\"400px\" style=\"background-color:white\">"
                + "<tr><td style=\"vertical-align:top;background-color: white\">IMDB&nbsp;info:</td><td style=\"background-color: white\">" + imdbLinkFilm + "&nbsp;&nbsp;|&nbsp;&nbsp;" + imdbLinkActors + "</td><tr>"
                + "<tr><td style=\"vertical-align:top;background-color: white\">Director:</td><td style=\"background-color: white\">" + Director  + "</td><tr>"
                + "<tr><td style=\"vertical-align:top;background-color: white\">Genre:</td><td style=\"background-color: white\">" + Genre+ "</td><tr>"
                + "<tr><td style=\"vertical-align:top;background-color: white\">Company:</td><td style=\"background-color: white\">"+ Company + "</td><tr>"
                + "<tr><td style=\"vertical-align:top;background-color: white\">Awards:</td><td style=\"background-color: white\">" + Award + "</td><tr>"
                + "</table></div><br>"

                // Film funstuff div
                + "<div style=\"overflow-y: auto;overflow-x: hidden;height:250px;background-color: #fff;-moz-border-radius: 5px;-webkit-border-radius: 5px;border: 1px solid #000;padding: 10px;\" >" + funstuff + "</div><br>"                              
              
                // Film certification div
                + "<div style=\"overflow-y: auto;overflow-x: hidden;height:64px;background-color: #fff;-moz-border-radius: 5px;-webkit-border-radius: 5px;border: 1px solid #000;padding: 10px;\" ><b>Certification:</b><br>" + certification + "</div>"
              
                // A message for users so they know they can close again 
                // by clicking the IMDB button. alse allows to close div 
                // from bottom. is nice
                + "<br>&nbsp;&nbsp;&nbsp;Click <A title=\"Hide IMDB details\" href=\"#\" onclick=\"document.getElementById('"+divName + "').style.display = 'none'; return false; \" ><img align=\"top\"  src=\""+ imgLinkImdbLogo +"\"></a> to hide the details."                                 
               
              // Cast
              + "</td><td style=\"background-color: white;vertical-align: top\" ><div style=\"overflow-y: auto;overflow-x: hidden;width:370px; height:570px;background-color: #fff;-moz-border-radius: 5px;-webkit-border-radius: 5px;border: 1px solid #000;padding: 10px;\" ><table cellpadding=0 cellspacing=0 width=\"350px\">" + cast + "</table><\div>"                                         
              
              // Poster image 
              + "</td><td style=\"background-color: white; vertical-align: top\">" + PhotoLink + "</td></tr>" 
              + "</td><td colspan=\"2\" style=\"background-color: white; vertical-align: top\">"
              
              + "</td></tr></table>"
              + "</td></tr></table>"                                                                                                            
              + "</tr></div>"

              // Append the new row HTML to the table.
              movieBody.innerHTML += Details;
                                       
        }
    
    else
    {
      // Fialed for some reason? retry
      if(RetryNumbers > 0)
        getData_IMDB(movieBody, imdbLink, iLink, PostID, --RetryNumbers)
    }
    
    
    }
    
   });
}
